// src/components/PersonalInfo.jsx
function PersonalInfo() {
  const personalInfo = [
    { src: "/images/IMG_0881.webp", alt: "Ryan's headshot", type: "image" },
    { content: "I am a computer science student at Montclair State University. I'm a senior and I'm currently looking for a summer internship this year to advance my career and develop new skills in a work environment.", type: "text" },
    { content: "In my free time, I like to play video games, play sports with friends, and spend time with my family.", type: "text" }
  ];

  return (
    <section className="personalinfo">
      {personalInfo.map((item, index) => (
        <div key={index} className={item.type}>
          {item.type === "image" ? (
            <img src={item.src} alt={item.alt} />
          ) : (
            <p>{item.content}</p>
          )}
        </div>
      ))}
    </section>
  );
}

export default PersonalInfo;
